import React from 'react';
import './css/TodoCss.css';
type TodoPorps = {
  form: string;
  todo: string;
}
const Todo: React.FC<TodoPorps> = ({form, todo}) => {
  return(
    <main className='todo-list'>
      <div className='title'>
      오늘 할 일
      </div>
      <div className="list">
        <section className='forms'>
          날짜 : {form}
        </section>

        <section className='todos'>
          할 일 : {todo}
        </section>
      </div>

      <div className = "Todo-Edit">
        <img src = "EditImg.png"/>
        <img src = ""/>
      </div>
    </main>
  )
};

export default Todo;
